import { useState } from "react"

export function Loading(){
    const [load,set_load]=useState('loading')
    useState(()=>{
        var timer=setInterval(() => {
            set_load(load+'.')
            if(load==='loading...'){
                clearInterval(timer)
            }
        },100);

    },[])
    return(
        <div>
            {load}
        </div>
    )
}
